import React from 'react';
import '../styles/global.css';

const MainPage: React.FC = () => {
  return (
    <div style={{
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      height: '100vh',
      width: '100%',
    }}>
      <h1 style={{
        fontSize: '4rem',
        fontWeight: 'bold',
        letterSpacing: '0.1em',
      }}>
        Moment4U
      </h1>
    </div>
  );
};

export default MainPage;
